INSERT INTO `pr_artist` VALUES (3,'32','CELEBRATING THE STRENGTHS, TALENT, AND PASSION OF OUR PHOTORUNNER ARTISTS. ','  Whether they&#039;re traveling the world or shooting right in their home of Estonia, photographer Rasmus Jurkatam and videographer Janek Toomikas work as a team to capture authentic, meaningful moments. Learn more about June&rsquo;s Signature Artists of the Month. ','&lt;div class=&quot;container&quot;&gt;\r\n&lt;h3 class=&quot;col-md-12 section_head&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;span style=&quot;color:rgb(64, 224, 208)&quot;&gt;Rasmus Jurkatam and Janek Toomikas have a lot of similarities &amp;mdash; they are both film fanatics, have grandfathers who were amateur photographers, and share a love of travel. But there&amp;rsquo;s one thing in particular that unites them more than anything else: a strong passion for visual language.&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;\r\n&lt;/div&gt;\r\n','608c7f61927747648c6d97efcfa41db4.jpg','1'),(4,'28','THIS IS A TEST STORY','A WATERMARK STORY','&lt;p&gt;Who is this man? This is a test. Photorunner open soon&lt;/p&gt;\r\n','ad210d9888a55c5f21f24b233fbbb3d1.jpg','1');
