INSERT INTO `pr_pages` VALUES (1,'About Us','Photorunner  Provides 3 click Payment Galleries for Photographers','&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;\r\n&lt;div style=&quot;font-size: 16px; margin-top: 50px;&quot;&gt;\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Dear Customers&lt;/p&gt;\r\n&amp;nbsp;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:calibri,sans-serif&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Photorunner provides 3 click payment galleries for photographers.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1.Upload&amp;nbsp; 2.Set price&amp;nbsp; 3:Send photo link to the customer. The watermark disappears when the customer pays with creditcard, PayPal or SMS (Norwegian phone numbers).&lt;/p&gt;\r\n\r\n&lt;p&gt;Photorunner is created and owned by FHE FOTO, Norway. Our customers needs for quick access to photos for Facebook and other medias during events made us develop Photorunner. This is a payment system that ensures the photographers intellectual rights with one payment brand, PHOTORUNNER. The watermark will disappear once payment is completed, and customers will have access to web size-photos or full resolution photos only a few minits after the photos are done. We also offer prints. Payments are handled securely by Stripe, and customers have their own secure, private photo gallery.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Registering Photographers.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;PhotoRunner is made for helping photographers and theyr customers with the payment issue. We welcome all photographers. Fulltime and parttime photographers. And if you have photo as a hobby, its the right time to earn money on it.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n',1),(2,'Press','Lorem Ipsum is simply dummy text of the printing and typesetting industry.','&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width:90%; margin-left:auto; margin-right:auto;&quot;&gt;\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&amp;#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:20px;&quot;&gt;Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&amp;#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:20px;&quot;&gt;Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsu