more screenshots or stealing of photos, no more fuss with phone calls and e-mails &amp;nbsp;to get the payment in place. PhotoRunner provides the easy solution for photographers and customers alike.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Photographers:&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;color:#00B050&quot;&gt; Send the gallery directly &amp;nbsp;to your client. The images are protected by watermark till the customer pays. As soon as the payment is done, the watermark disappears.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Sell jpg-files &amp;ndash;small&amp;nbsp; or large, or sell prints. You decide.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;You can work whenever you want, all over the world. The only thing you need is a camera with wifi transfer to your tablet or computer.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;1.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Upload&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;2.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Set price&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;3.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Send gallery&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;PhotoRunner is perfect for all kinds of event photography.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;Do your photos today - get payd tomorrow.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n',1),(4,'Affiliates','In July, we offer FIneart print to our customers. Studio Technika, Oslo, Norway, has 30 years xperience printing Fine Art for wo','&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;If you choose the option Print FineArt, you are in company with the big names in&amp;nbsp; photography. Studio Technika in Oslo, Norway have more than thirty years xperience of printing for the most atractive galleries all over the world. New York, Berlin, Milano, Oslo.&amp;nbsp; with names like Per Maning, Tom Sandberg, Morten Krogvold.&amp;nbsp; All prints are carefully handmade, on the most delicate paper you wish. Chemical and Inchprint. You decide. Or let us choose for you.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;Cellphonephotos: We also offer a directly printline to the photolab. It means you can print FineArt of your favoritephotos.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;facilities&quot;&gt;\r\n&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;